INSERT INTO `blog` (`id`, `title`, `featured_image`, `category`, `content`, `name`, `createdon`, `time`) VALUES
(26, 'Indian Economy and Startup Contribution', 'http://www.startup-buzz.com/wp-content/uploads/2016/07/startup-notepad.jpg', 'akshay', '<p>In ancient manuscripts, another means to divide sentences into paragraphs was a line break (<a title="Newline" href="https://en.wikipedia.org/wiki/Newline">newline</a>) followed by an <a title="Initial" href="https://en.wikipedia.org/wiki/Initial">initial</a> at the beginning of the next paragraph. An initial is an oversize capital letter, sometimes outdented beyond the margin of text. This style can be seen, for example, in the original <a title="Old English" href="https://en.wikipedia.org/wiki/Old_English">Old English</a> manuscript of <a title="Beowulf" href="https://en.wikipedia.org/wiki/Beowulf">Beowulf</a>. Outdenting is still used in English typography, though not commonly.<sup id="cite_ref-Bringhurst2005_4-0" class="reference"><a href="https://en.wikipedia.org/wiki/Paragraph#cite_note-Bringhurst2005-4">[4]</a></sup> Modern English typography usually indicates a new paragraph by <a title="Indentation (typesetting)" href="https://en.wikipedia.org/wiki/Indentation_(typesetting)">indenting</a> the first line. This style can be seen in the (handwritten) <a title="United States Constitution" href="https://en.wikipedia.org/wiki/United_States_Constitution">United States Co</a></p>\n<h2><span id="Typographical_considerations" class="mw-headline">Typographical considerations</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a title="Edit section: Typographical considerations" href="https://en.wikipedia.org/w/index.php?title=Paragraph', 'Yadnesh Kulkarni', 'Fri Mar 24 2017', '2017-04-02 10:06:16'),
(27, 'Funding Startups for 2017', 'http://i.huffpost.com/gen/1517406/images/o-STARTUP-facebook.jpg', 'akshay', '"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?"', 'Akshay Potdar', 'Fri Mar 24 2017', '2017-04-02 10:03:10'),
(28, 'Meet Ups', 'http://images.huffingtonpost.com/2016-06-05-1465144380-7190217-startups.jpg', 'yadnesh', '"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?"', 'Shahaji Shinde', 'Fri Mar 24 2017', '2017-04-02 10:03:14');
